import { Component } from "react";
import React from "react";
import { PageMain } from "core";
import NotificationSystem from "react-notification-system";
import { GetUrl } from '../../../utils/generals'
import Constants from '../../../utils/constants'
import RequestListSection from '../../../sections/requestListSection'

export default class RequestBillingListPage extends Component
{
    constructor(props)
    {
        super(props);

        this.state = { isLoading: false };
        this.notificationSystem = React.createRef();
    }

    // Events.
    render()
    {
        return (
            <>
                <PageMain context={ this } title="فهرست درخواست دانلود صورتحساب ها" icon="list-search" isLoading={ this.state.isLoading }
                    footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                    topButtons={[
                        {
                            title: "افزودن درخواست دانلود صورتحساب",
                            url: GetUrl("requestBillingAddPage"),
                            color: "outline-primary",
                            icon: "receipt",
                        },
                    ]}>
                        <RequestListSection notificationSystem={ this.notificationSystem } title="جزئیات فهرست درخواست دانلود صورتحساب ها" requestTypeId= { Constants.RequestType.Billing }/>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
